import React from 'react';

const Category = () => {
  return (
    <nav className="navbar navbar-expand-md sticky-top py-3 navbar-dark" id="mainNav">
      <div className="container">
        {/* Move the toggle button to the right */}
        <button 
          data-bs-toggle="collapse" 
          className="navbar-toggler ms-auto" 
          data-bs-target="#navcol-1"
        >
          <span className="visually-hidden">Toggle navigation</span>
          <span className="navbar-toggler-icon"></span>
        </button>
        
        <div className="collapse navbar-collapse ms-auto" id="navcol-1">
          <ul className="navbar-nav">
            <li className="nav-item"><a className="nav-link" href="">All</a></li>
            <li className="nav-item"><a className="nav-link" href="">Food</a></li>
            <li className="nav-item"><a className="nav-link" href="">Drink</a></li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Category;
